//doc.rust-lang.org/1.75.0/std/primitive.unit.html\">()</a>&gt;&gt;\n) -&gt; <a class=\"enum\" href=\"https://doc.rust-lang.org/1.75.0/core/result/enum.Result.html\" title=\"enum core::result::Result\">Result</a>&lt;[<a class=\"primitive\" href=\"https://doc.rust-lang.org/1.75.0/std/primitive.u8.html\">u8</a>; <a class=\"primitive\" href=\"https://doc.rust-lang.org/1.75.0/std/primitive.array.html\">32</a>], <a class=\"enum\" href=\"sp_runtime/enum.DispatchError.html\" title=\"enum sp_runtime::DispatchError\">DispatchError</a>&gt;</h4></section></summary><div class='docblock'>Send an XCM to be executed by a remote location. <a href=\"staging_xcm_builder/controller/trait.SendController.html#tymethod.send\">Read more</a></div></details></div></details>","SendController<<T as Config>::RuntimeOrigin>","westend_runtime::XcmPallet"],["<details class=\"toggle implementors-toggle\" open><summary><section id=\"impl-VersionChangeNotifier-for-Pallet%3CT%3E\" class=\"impl\"><a class=\"src rightside\" href=\"src/pallet_xcm/lib.rs.html#2609\">source</a><a href=\"#impl-VersionChangeNotifier-for-Pallet%3CT%3E\" class=\"anchor\">§</a><h3 class=\"code-header\">impl&lt;T&gt; <a class=\"trait\" href=\"staging_xcm_executor/traits/on_response/trait.VersionChangeNotifier.html\" title=\"trait staging_xcm_executor::traits::on_response::VersionChangeNotifier\">VersionChangeNotifier</a> for <a class=\"struct\" href=\"pallet_xcm/pallet/struct.Pallet.html\" title=\"struct pallet_xcm::pallet::Pallet\">Pallet</a>&lt;T&gt;<span class=\"where fmt-newline\">where\n    T: <a class=\"trait\" href=\"pallet_xcm/pallet/trait.Config.html\" title=\"trait pallet_xcm::pallet::Config\">Config</a>,</span></h3></section></summary><div class=\"impl-items\"><details class=\"toggle method-toggle\" open><summary><section id=\"method.start\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/pallet_xcm/lib.rs.html#2618-2623\">source</a><a href=\"#method.start\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"staging_xcm_executor/traits/on_response/trait.VersionChangeNotifier.html#tymethod.start\" class=\"fn\">start</a>(\n    dest: &amp;<a class=\"struct\" href=\"staging_xcm/v4/location/struct.Location.html\" title=\"struct staging_xcm::v4::location::Location\">Location</a>,\n    query_id: <a class=\"primitive\" href=\"https://doc.rust-lang.org/1.75.0/std/primitive.u64.html\">u64</a>,\n    max_weight: <a class=\"struct\" href=\"sp_weights/weight_v2/struct.Weight.html\" title=\"struct sp_weights::weight_v2::Weight\">Weight</a>,\n    _context: &amp;<a class=\"struct\" href=\"staging_xcm/v4/struct.XcmContext.html\" title=\"struct staging_xcm::v4::XcmContext\">XcmContext</a>\n) -&gt; <a class=\"enum\" href=\"https://doc.rust-lang.org/1.75.0/core/result/enum.Result.html\" title=\"enum core::result::Result\">Result</a>&lt;<a class=\"primitive\" href=\"https://doc.rust-lang.org/1.75.0/std/primitive.unit.html\">()</a>, <a class=\"enum\" href=\"staging_xcm/v3/traits/enum.Error.html\" title=\"enum staging_xcm::v3::traits::Error\">Error</a>&gt;</h4></section></summary><div class=\"docblock\"><p>Start notifying <code>location</code> should the XCM version of this chain change.</p>\n<p>When it does, this type should ensure a <code>QueryResponse</code> message is sent with the given\n<code>query_id</code> &amp; <code>max_weight</code> and with a <code>response</code> of <code>Response::Version</code>. This should happen\nuntil/unless <code>stop</code> is called with the correct <code>query_id</code>.</p>\n<p>If the <code>location</code> has an ongoing notification and when this function is called, then an\nerror should be returned.</p>\n</div></details><details class=\"toggle method-toggle\" open><summary><section id=\"method.stop\" class=\"method trait-impl\"><a class=\"src rightside\" href=\"src/pallet_xcm/lib.rs.html#2645\">source</a><a href=\"#method.stop\" class=\"anchor\">§</a><h4 class=\"code-header\">fn <a href=\"staging_xcm_executor/traits/on_response/trai